columns.formula:
// If there's a "Custom Profile Picture" use that, otherwise use the most favorited picture tagged with the team member
ifblank(
  [Custom Profile Picture],
  [Event Photos]
    .Filter(
      [Team Members].Contains(thisRow)
    )
    .sort(
      False, Favorite
    )
    .Sort(
      False, [Best Ever]
    )
    .first()
    .Photo
)
